import React from "react";

export default function NavBar(props) {
    const width = "5%";
    const pageName = props.pageName;
    



    return (
        <div>
            <nav className="navbar navbar-expand-lg bg-primary shadow-sm rounded border border-dark">
          <div className="container-fluid">
            <div className="row">
              <div className="col-auto">
                <a className="navbar-brand active" id="logo" href="./index.html"><img src="img/walking.png" alt="a logo of a man walking" width={width}></img>Get To The Trail</a>
              </div>
            </div>
            
            <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                    <Link pageName = "Trial" isActive="false"/>
                    <li className="nav-item px-4">
                    <a className="nav-link" href="./html/shop.html">Shop</a>
                    </li>
                    <li className="nav-item px-4">
                    <a className="nav-link" href="./html/user.html">User</a>
                    </li>
                </ul>
            </div>
          </div>
        </nav>
        </div>
        
        
    )
}

function Link(props){
  const name = props.pageName 
  const isActive = props.isActive
  const linkClassList = ["nav-link"];
  if (isActive){
    linkClassList.push("active");
  }
  return (
    <div>
      <li className="nav-item px-4">
        <a className={linkClassList} href="./html/user.html">{name}</a>
      </li>
    </div>
  )
}
